import * as React from 'react';
import {
  Text,
  View,
  StyleSheet,
  FlatList,
  TouchableOpacity,
} from 'react-native';

export default class App extends React.Component {
  constructor(propos) {
    super(propos);
    this.state = {
      genero: [
        { genero: 'MASCULINO' },
        { genero: 'FEMININO' },
        { genero: 'INFANTIL' },
      ],
    };
  }
  render() {
    return (
      <View style={styles.fundo}>
        <View style={styles.header}>
          <Text style={{ color: 'white', fontSize: 24}}> Categoria </Text>
        </View>

        <FlatList
          data={this.state.genero}
          renderItem={({ genero }) => (
            <TouchableOpacity style={styles.genero}>
              <Text>{genero.genero}</Text>
            </TouchableOpacity>
          )}
        />
      </View>
    );
  }
}

const styles = StyleSheet.create({
  fundo: {
    backgroundColor: '#d3d3d3',
  },
  header: {
    backgroundColor: '#000999',
    alignItems: 'center',
    fontWeight: 'bold',
    padding: 12,
    margin: 20,

  },
  genero: {
    backgroundColor: '#ffffff',
    alignItems: 'center',
    fontWeight: 'bold',
    padding: 18,
    margin: 8
  },
});
